import React from "react";
import 'font-awesome/css/font-awesome.min.css';

const Todolist=(props)=>{
    const {id} = props;
   
    return(
        <>
        <div className="todo">
            <i className="fa fa-times"
             aria-hidden="true" 
             onClick={()=>{
                 props.onSelect(id);
             }} /><li>{props.text}</li>
        </div>        

        </>
    )
};

export default Todolist;
